import React from 'react';
import logoImage from './iphonenairobi2.png'; // Substitua './logo.png' pelo caminho da sua imagem de logo
import * as S from "../App.styles";


function Logo() {
  return (
    <div>
      <LogoImg src={logoImage} alt="Logo" />
    </div>
  );
}

export default Logo;
